import React from 'react';
import logo from './logo.svg';
import './Card.css';

const Card = ({robots , run}) => {
	return (

	<div className="cardbox">
       <img src={logo} alt='robot' width='300px' height='300px'/>
	   <div>
			<h2>{robots.name}</h2>
			<p>Username : {robots.username}</p>
			<p>{robots.email}</p>
			<button onClick={run}>Ajouter au panier</button>
	   </div>
	</div>


	);
}
export default Card;
